    'featured_listings.HowDoesItWork': 'Miten toimia?',
    'featured_listings.HowDoesItWork_New': 'Luettelon ensimm\xE4isille ja hakutulosten n\xE4kyville ilmoituksille ajankohtaiset ilmoitukset n\xE4kyv\xE4t asiaankuuluvassa alaluokassa ja ne vaihtuvat satunnaisesti kyseisen alaluokan ja alueen ajankohtaisten ilmoitusten mukaan. Kaikissa tapauksissa ajankohtaisten ilmoitusten valinta luodaan satunnaisesti, jotta kaikilla ajankohtaisten ilmoitusten ostajilla on sama mahdollisuus saada ilmoitus n\xE4kyville sivustolle. Siksi on mahdollista, ett\xE4 ilmoituksesi eiv\xE4t aina n\xE4y asiaankuuluvassa Ajankohtaiset ilmoitukset -osiossa.',
    'featured_listings.HowDoIBuyAFeaturedListing': 'Miten ostan n\xE4kyv\xE4n listauksen?',
    'featured_listings.HowDoIBuyAFeaturedListing_New': 'Voit ostaa ajankohtaisen ilmoituksen l\xE4hetysprosessin viimeisest\xE4 vaiheesta, jossa vahvistetaan, ett\xE4 ilmoituksesi on julkaistu tai kohdasta Oma OLX. Prosessi on yksinkertainen. You valita kuinka monta viikkoa haluat mainostaa ilmoitustasi. Siirryt sitten maksusivulle, jossa on erilaisia \u200B\u200Bmaksuvaihtoehtoja. Maksun j\xE4lkeen, saat vahvistuksen siit\xE4, ett\xE4 ilmoituksesi esitet\xE4\xE4n valitun aikaa. Saat vahvistuksen s\xE4hk\xF6postitse, jos mainoksesi noudattaa OLX:n k\xE4ytt\xF6ehtoja. Huomaa, ett\xE4 ei ostetuista ajankohtaisista ilmoituksista ei anneta mit\xE4\xE4n palautuksia. Kaikki ajankohtaisten ilmoitusten myynnit ovat lopullisia.',
